import React, { Component } from "react";
import { Card, CardBody, Row, Col, Table, Button, Container } from "reactstrap";
export class AdminUsuarios extends Component {
  render() {
    return (
      <div>
        <div className="page-wrapper d-block">
          <div className="page-content container-fluid">
            <Container>
              <Card>
                <CardBody>
                  <Table className="no-wrap v-middle" responsive>
                    <thead>
                      <tr className="border-0">
                        <th className="border-0">Email</th>

                        <th className="border-0">Role</th>
                      </tr>
                    </thead>
                    {items &&
                      items.map(
                        ({
                          numero,
                          color,
                          prioridad,
                          equipo,
                          fecha,
                          descripcion,
                          estado,
                          _id,
                        }) => {
                          const timeDiferrence = moment().diff(fecha, "days");
                          return (
                            <tbody key={_id}>
                              <tr>
                                <td>
                                  <div className="d-flex no-block align-items-center">
                                    <div className="">
                                      <Link
                                        to={{ pathname: `/tarjeta/${_id}` }}
                                      >
                                        <h5 className="mb-0 font-16 font-medium">
                                          {numero}
                                        </h5>
                                      </Link>
                                    </div>
                                  </div>
                                </td>
                                {color === "Azul" ? (
                                  <td>
                                    <li className="border-0 p-0 text-info list-inline-item">
                                      <i className="fa fa-circle"></i> {color}
                                    </li>
                                  </td>
                                ) : null}
                                {color === "Roja" ? (
                                  <td>
                                    <li className="border-0 p-0 text-danger list-inline-item">
                                      <i className="fa fa-circle"></i> {color}
                                    </li>
                                  </td>
                                ) : null}
                                {color === "Verde" ? (
                                  <td>
                                    <li className="border-0 p-0 text-success list-inline-item">
                                      <i className="fa fa-circle"></i> {color}
                                    </li>
                                  </td>
                                ) : null}
                                {color === "Amarilla" ? (
                                  <td>
                                    <li className="border-0 p-0 text-warning list-inline-item">
                                      <i className="fa fa-circle"></i> {color}
                                    </li>
                                  </td>
                                ) : null}
                                <td>{equipo}</td>
                                <td>
                                  {prioridad}

                                  {prioridad === "Alta" &&
                                    estado === "Abierta" &&
                                    timeDiferrence >= 15 && (
                                      <li className="border-0 p-0 text-danger list-inline-item">
                                        ⚠️
                                      </li>
                                    )}
                                  {prioridad === "Media" &&
                                    estado === "Abierta" &&
                                    timeDiferrence >= 30 && (
                                      <li className="border-0 p-0 text-danger list-inline-item">
                                        ⚠️
                                      </li>
                                    )}
                                  {prioridad === "Baja" &&
                                    estado === "Abierta" &&
                                    timeDiferrence >= 60 && (
                                      <li className="border-0 p-0 text-danger list-inline-item">
                                        ⚠️
                                      </li>
                                    )}
                                </td>

                                <td>
                                  {moment(fecha).format("DD/MM/YYYY LTS")}
                                </td>
                                <td>{descripcion}</td>

                                <td>{estado}</td>
                                <td>
                                  <Link to={{ pathname: `/tarjeta/${_id}` }}>
                                    <Button
                                      color="success"
                                      className="btn bg-secondary border border-secondary"
                                    >
                                      Ver detalle
                                    </Button>
                                  </Link>
                                </td>
                              </tr>
                            </tbody>
                          );
                        }
                      )}
                  </Table>
                </CardBody>
              </Card>
            </Container>
          </div>
        </div>
      </div>
    );
  }
}
const mapStateToProps = (state) => {
  return {
    users: state.users,
    user: state.auth.user,
  };
};
export default connect(mapStateToProps, { getUsers })(AdminUsuarios);
